import React, { Component } from 'react';

class Login extends Component {
    constructor(){
        super()
        this.state = {
            username:"",
            password:"",
        }
    }
    search(key) {
        this.setState({ lastSearch: key })
        fetch('http://localhost:3000/resto?q=' + key).then(
            (response) => {
                response.json().then(
                    (result) => {
                        console.warn(result.length)
                        result.length > 0 ? this.setState({ searchData: result }) : this.setState({ searchData: null });
                    })
            })
    }
    render() {
        return (
            <div>
                <h2>Login Page</h2>
                <input type="text" name='username' onChange={(e)=>this.setState({username:e.target.value})} />
                <input type="password" name='password' onChange={(e)=>this.setState({password:e.target.value})} />
                <button onClick={()=>this.login()}>Login</button>
            </div>
        );
    }
}

export default Login;
